const longestPalindrome = require('../katas/5.longest-palindromic-substring');

describe('longestPalindrome', () => { 
    test('input "babad" should return "bab" or "aba"', () => { 
        const input = 'babad';
        expect(longestPalindrome(input)).toMatch(/(bab|aba)/i)
     })
    test('input "cbadd" should return "dd"', () => { 
        const input = 'cbadd';
        expect(longestPalindrome(input)).toBe('dd')
     })
    test('input "cbbd" should return "bb"', () => { 
        const input = 'cbbd';
        expect(longestPalindrome(input)).toBe('bb')
     })
     test('input "ac" should return "a"', () => { 
        const input = 'ac';
        expect(longestPalindrome(input)).toBe('a')
     })
     test('input "bb" should return "bb"', () => { 
        const input = 'bb';
        expect(longestPalindrome(input)).toBe('bb')
     })
     test('input "aacabdkacaa" should return "aca"', () => { 
        const input = 'aacabdkacaa';
        expect(longestPalindrome(input)).toBe('aca')
     })
     test('input long string should return', () => { 
        const input = "";
        expect(longestPalindrome(input)).toBe('ranynar')
     })
     test('input long string should return', () => { 
        const input = "";
        expect(longestPalindrome(input)).toBe('fklkf')
     })
     test('input long string should return', () => { 
        const input = "";
        expect(longestPalindrome(input)).toBe('sknks')
     })
 })
